ISLAMABAD, Jun 19 (APP):Minister for Power Engineer Khurram Dastgir Khan on Sunday reached Tehran (Iran)  on a four-day to discuss the import of electricity from Iran.
The minister was received by Iranian Deputy Minister of Energy for International Affairs Muhammad Ali Farahnakian at the Airport, said a statement issue here.
